import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, useParams } from "react-router-dom";
import "./index.css";

const projects = [
  {
    id: "semantic-search",
    title: "AI-Powered Semantic Search & Product Ranking System",
    date: "April 16, 2025",
    description:
      "In a world of millions of product listings, relevance is everything... semantic search comes into play. I developed a system that goes beyond keywords and retrieves results based on meaning—exactly how humans think.",
    tags: ["AI", "Search", "NLP"]
  },
  {
    id: "rag-gpt",
    title: "RAG-Based Emerald GPT – AI Assistant with Pinecone",
    date: "April 16, 2025",
    description:
      "Built a RAG-based AI assistant using GPT and Pinecone to perform semantic searches over vector databases with enhanced relevance and response quality.",
    tags: ["GPT", "Pinecone", "RAG"]
  }
];

function Header() {
  return (
    <header className="header">
      <div className="container header-content">
        <h1 className="logo"> AI Project Blog</h1>
        <Link to="/" className="home-link">Home</Link>
      </div>
    </header>
  );
}

function Footer() {
  return (
    <footer className="footer">
      © 2025 Deepika's AI Blog. All rights reserved.
    </footer>
  );
}

function Home() {
  return (
    <div className="page">
      <Header />
      <main className="main">
        <div className="project-grid">
          {projects.map((project) => (
            <Link to={`/project/${project.id}`} key={project.id} className="project-card">
              <div className="card-body">
                <p className="project-date">{project.date}</p>
                <h3 className="project-title">{project.title}</h3>
                <div className="tag-container">
                  {project.tags.map((tag) => (
                    <span key={tag} className="tag">{tag}</span>
                  ))}
                </div>
              </div>
            </Link>
          ))}
        </div>
      </main>
      <Footer />
    </div>
  );
}

function ProjectPage() {
  const { id } = useParams();
  const project = projects.find((p) => p.id === id);

  if (!project) return <p className="not-found">Project not found</p>;

  return (
    <div className="page">
      <Header />
      <main className="main">
        <h1 className="project-heading">{project.title}</h1>
        <p className="project-date">{project.date}</p>
        <p className="project-description">{project.description}</p>
        <div className="tag-container">
          {project.tags.map((tag) => (
            <span key={tag} className="tag">{tag}</span>
          ))}
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/project/:id" element={<ProjectPage />} />
      </Routes>
    </Router>
  );
}
